import React from 'react';

export default function Messages(props) {
  const renderMessages = () => {
    const { messages } = props;
    const renderList = messages.map((e, i) => (
      <li key={i}>
        <p>
          <span>{e.name}</span>
          {e.message}
        </p>
      </li>
    ));
    return renderList;
  };
  return (
    <div>
      <ul>{renderMessages()}</ul>
    </div>
  );
}
